import "./BingoSquare.css";

function BingoSquare({ info, onSquareClick, row, col }) {
  return (
    <div
      className="bingo-square"
      style={{
        backgroundColor: info.activated ? "blue" : "white",
        width: "100px",
        height: "100px",
        display: "inline-block",
        border: "1px solid gray",
        cursor: "pointer",
        verticalAlign: "middle",
        textAlign: "center",
      }}
      onClick={() => onSquareClick(row, col)}
    >
      <div className="item-text" style={{ display: "flex" }}>
        {info.item}
      </div>
    </div>
  );
}

export default BingoSquare;
